import React from "react";

import styled from "styled-components";

const ImgBlock = styled.section``;

const ImageBlock = () => {
  return (
    <ImgBlock>
      <div className="all_tshirts"></div>

    </ImgBlock>
  );
};

export default ImageBlock;
